  "Broker Comment" : "APPROXIMATELY 10-1-71 TO 7-13-73, AS AN OFFICER OF THE MUTUAL FUND CORP. OF DEL., INC., A REGISTERED BROKER/DEALER WITH NASD, I WAS CENSURED AND FINED FOR VIOLATION OF ART. III, SEC. I OF THE NASD.  ON OR ABOUT 7-12-73, ANOTHER OFFICER AND I REMOVED THE SECURITIES THAT WE PERSONALLY SUBORDINATED TO THE FIRM IN ORDER TO MEET NET CAPITAL REQUIREMENTS.  SECURING OUR SECURITIES CONSTITUTED A VIOLATION OF THE RULES OF FAIR PRACTICE.  SHORTLY THEREAFTER, TWO OTHER OFFICERS AND I RESIGNED AND THE CORPORATION DISCONTINUED BUSINESS AND OPERATION.  IT WAS DURING THIS INTERVAL THE COMPANY AND WE AS OFFIERS WERE IN VIOLATION OF NET CAPITAL REQUIREMENTS THE MATTER WAS CALLED FOR REVIEW BY THE BOARD OF GOVERNERS PURSUANT TO SEC. 15 OF THE ASSOC. CODE OF PROCEDURE FOR HANDLING TRADE PRACTICE COMPLAINTS.  IN A DECISION OF THE DISTRICT BUSINESS CONDUCT COMMITTEE, THE MUTUAL FUND CORP OF DELAWARE, TWO RESPONDENTS AND I WERE FINED $250.00 EACH AND ASSESSED COST OF THE PROCEEDING IN THE AMOUNTS OF $142.80 THE FINE AND COSTS WERE PAID IN FULL BY ALL PARTIES."
}
